import React, { Fragment } from 'react';
import { BroswerRouter as Router, Route, Switch } from 'react-router-dom';
import { Navbar } from './components/layout/Navbar';
import { Landing } from './components/layout/Landing';
import './App.css';

const App = () => (
  <Router>
    <Fragment>
      <Navbar></Navbar>
      <Landing></Landing>
    </Fragment>
  </Router>
);

export default App;
